import "./App.css";
const { io } = require("socket.io-client");
var socket = io();

var b = document.getElementById("btn");
b.addEventListener("click", (e) => {
  socket.emit("test message");
});
function App() {
  return (
    <div className="App">
      <header className="App-header">
        <button id="btn">click</button>
      </header>
    </div>
  );
}

export default App;
